import React, { Component } from 'react'
import styled from 'styled-components'

const MAIN = styled.div`
`
const SUB1 = styled.div`
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
    margin-bottom: 10px;
`

const SUB11 = styled.div`
    background-color: #000;
    height: 35vh;
    width: 45vh;
    border-radius: 10px;
    opacity: 60%;
`

const SUB12 = styled.div`
    background-color: #000;
    height: 35vh;
    width: 100vh;
    border-radius: 10px;
    opacity: 60%;
`


export default class DexData extends Component {
    render() {
        return (
            <MAIN>
                <SUB1>
                    <SUB11></SUB11>
                    <SUB11></SUB11>
                </SUB1>
                <SUB1>
                    <SUB12></SUB12>
                </SUB1>
            </MAIN>
        )
    }
}
